# Note: The CvocVocabulary description or annotation body fields could be vulnerable if displayed without proper sanitization.
# The injection itself is in a data field, not the ID directly, as an ID is less likely to directly render an XSS payload.
# If the ID were directly rendered on a page, then we could inject into the ID field.
# For this example, let's assume the body of annotations or description of the vocabulary could be rendered.
# We'll use a valid ID to retrieve existing data and assume one of the fields could contain the payload.
# In a real scenario, we might try to CREATE or UPDATE a vocabulary with an XSS payload in such fields.

# The schema does not directly expose any URL fetching functionality.
# SSRF is typically found in arguments that accept URLs to fetch external content.
# Since no such explicit argument exists for CvocVocabulary, we'll craft one
# that hypothetically *could* lead to an SSRF if the 'description' field
# were internally processed by a server-side component that fetched content
# based on its value. This is a speculative query based on common SSRF patterns.
# A more likely scenario would involve an argument like 'imageUrl' or 'externalResource'.

query {
  CvocVocabulary(id: "vocab-789") {
    id
    name
    description # Hypothetically, if description could be interpreted as a URL to fetch content.
  }
}
# A direct SSRF test would look more like:
# query {
#   CvocVocabulary(id: "vocab-789", externalResourceUrl: "http://169.254.169.254/latest/meta-data/") {
#     id
#     name
#   }
# }
# But given the schema, we must simulate against an existing field.

# The schema does not expose any direct arguments that would typically execute OS commands.
# OS Command Injection often occurs when user input is used in shell commands.
# Similar to SSRF, without a specific field like `filePath` or `commandToExecute`,
# we inject into a string field expecting backend processing.
# We'll target the 'name' field assuming it might be used in a backend script without proper sanitization.
query {
  CvocVocabulary(id: "vocab-999") {
    id
    name # Could be vulnerable if `name` is used in a system call like `system("echo " + name)`
  }
}
# If an argument like `filePath` existed, a more direct attack would be:
# query {
#   CvocVocabulary(id: "vocab-999", filePath: "image.png; cat /etc/passwd") {
#     id
#   }
# }

# Path Injection typically involves manipulating file paths.
# The provided schema doesn't have fields that explicitly relate to file paths.
# We'll assume a hypothetical scenario where the 'identifier' field might be used
# to construct a file path on the backend for logging or data storage.
query {
  CvocVocabulary(id: "vocab-path-test") {
    id
    identifier # Assuming this could be used in a path operation like `readFile('/data/' + identifier + '.json')`
  }
}
# If there was an explicit file-related field, it would be more direct:
# query {
#   CvocVocabulary(id: "vocab-path-test", filename: "../../etc/passwd") {
#     id
#     name
#   }
# }

query {
  CvocVocabulary(id: "vocab-html-test") {
    id
    description # If this description is rendered directly in a web page without HTML encoding.
  }
}
# Similar to XSS, if the `description` or `name` field is rendered directly into HTML.
# The payload `<img src="x" onerror="alert('HTML Injection')">` or `<b>bold text</b>`
