# The XSS injection itself would likely target a specific field that renders user-supplied input without proper sanitization.
# For CvocVocabulary, fields like 'name', 'description', or 'annotations.body' are potential targets.
# An actual XSS payload would be "injected" as part of the data in the database,
# and then retrieved by a query. However, if the GraphQL layer itself doesn't sanitize input before
# storing or directly rendering, then the ID field could be vulnerable if displayed later without escaping.
# For example, if a backend vulnerability exists where an ID influences a rendered string without escaping.
# A more realistic injection point is if 'name' or 'description' are user-supplied and not sanitized before storage.
# E.g., if the ID field was ever directly displayed in an error message or log without sanitization:
# CvocVocabulary(id: "<script>alert('XSS')</script>")
# However, given the ID is often an internal identifier, we target a field that could hold user-generated content.
# We'll use a complex CvocConceptDescription or Annotation body that could embed XSS, then retrieve it.
# This query retrieves data that *could* contain XSS if previously injected into the database.

query {
  CvocVocabulary(id: "vocab-123") {
    id
    name
    concepts {
      items {
        id
        uri
      }
    }
  }
}
