# to make a request (e.g., fetching an image from a URL, or an external API call).
# In this schema, the 'uri' field of 'CvocConcept' is a potential vector if it's used by the backend
# to fetch data. A malicious 'uri' could point to internal network resources.
# The payload would be injected as part of the 'uri' when creating/updating CvocConcept,
# and then this query retrieves it, potentially triggering the SSRF on the backend if a fetch operation
# is associated with retrieving/processing the 'uri'.
# For instance, if 'uri' was 'http://localhost/admin' or 'file:///etc/passwd'.
# This query demonstrates an attempt to retrieve a 'uri' field, which could be an SSRF vector.

query {
  CvocVocabulary(id: "vocab-123") {
    id
    name
    concepts {
      items {
        id
        uri
      }
    }
  }
}
# Path Injection, similar to file system traversal, usually targets file paths.
# If any field value (e.g., 'id', 'name', 'uri', or another field not exposed in this schema
# but present in the backend) is used to construct a file path without proper sanitization,
# then `../` or absolute paths can be injected.
# For example, if 'id' was used to construct a file path like `/data/{id}.json`.
